{'sdk_element_id': 'BT-201-Contract', 'sdk_element_title': 'Modification Reason Description', 'sdk_element_xpath': '/*/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:ChangeReason/efbc:ReasonDescription', 'test_data_xpaths': [{'test_data_suite_oid': '67feb3e6dca42e57948af96a', 'test_data_suite_id': 'sampling_eforms_all_can-1.11', 'test_data_oid': '67feb3e6dca42e57948af96e', 'test_data_id': '447107-2024', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:ChangeReason/efbc:ReasonDescription', 'value': 'Aneks nr 11 z dnia 08.07.2024 r. - W zwizku ze stwierdzeniem koniecznoci wykonania robt zamiennych, dodatkowych, rozszerzajcych zakres: 
1)	odtworzenie rozebranej nawierzchni drogowej i przywrcenia nawierzchni do stanu pierwotnego (ze wzgldu na konieczno zachowania przejazdu 
dla autocystern na teren skadu MPS podczas trwajcego litraowania zbiornikw paliwowych roboty odtworzeniowe nawierzchni bd mogy rozpocz si po zakoczeniu pomiarw); 
2)	wykonanie dojcia do obiektu nr 31 (wykonanie dojcia jest niezbdne dla prawidowego funkcjonowania obiektu oraz w celu skutecznego odbioru inwestycji przez organy Nadzoru Budowlanego);
3)	zamontowanie systemu grzania rur przewodem grzewczym oraz wykonania otuliny termoizolacyjnej w paszczu ochronnym, 
4)	pomalowanie elewacji (cian zewntrznych) obiektw 11.1; do 11.6; 12.1; 12.2; 13; 14.1; 14.2; 14.3; 15.1; 15.2; 16.1; 16.2; 17, ktrego nie uwzgldniono w przedmiarach (pozostawienie cian zewntrznych bez malowania doprowadzi do ich degradacji w wyniku dziaania warunkw atmosferycznych);
5)	wykonanie wikszej ilo drogi patrolowej w stosunku do przedmiaru;
6)	zamiana sposobu wykonania stanowisk ogniowych na wniosek Uytkownika (zgodnie z dokumentacj projektow wzdu zewntrznego ogrodzenia terenu MPS naley wykona cztery stanowiska ogniowe. Uytkownik, podczas spotkania dotyczcego sprawdzenia zgodnoci zaprojektowanego ogrodzenia z wymogami normy obronnej zwrci uwag na trudno utrzymania w stanie suchym stanowisk zagbionych poniej terenu gruntu i wystpi z propozycj zamiany przedmiotowych stanowisk na naziemne (wykonane z prostoktnych bali drewnianych);
7)	zamontowanie 7 szt. zasuw DN250 zgodnie z projektem, a w wikszej iloci wzgldem przedmiaru (w przedmiarze brany sanitarnej wystpuje niedoszacowanie  6 szt.);
oraz zaniechania czci robt:
1)	wykonane iloci prac ziemnych polegajcych na wykopaniu, przemieszczeniu mas ziemnych i zasypaniu wykopw w iloci dostosowanej do potrzeb technologii wykonania tych prac, tj. iloci prac mniejszej ni przyjto w przedmiarze;
2)	wykonanie 555 szt. igofiltrw, tj. iloci igofiltrw mniejszej ni przyjto w przedmiarze (582 szt.);
3)	faktyczna powierzchnia drg betonowych (TYP 1, 2, 3) okazaa si mniejsza ni w przedmiarze, ktry by przeszacowany;
4)	faktycznie wbudowane iloci krawnika okazay si mniejsze ni w przedmiarze, ktry by przeszacowany;
5)	wykonanie elbetowej pyty fundamentowej bez izolacji pionowych i poziomych;
6)	w zwizku z wydzieleniem przez Zamawiajcego z czci zakresu prac objtych prawem opcji (budynek nr 04) Wykonawca nie wbudowa separatora i  fundamentu dla separatora SEP-3, 
7)	wykonanie mniejszej ilo fundamentw ni okrela przedmiar (w przedmiarze pozostawiono pyt fundamentow separatora SEP-3, po rezygnacji z wykonania budynku 04 wykonanie fundamentu pod separator SEP-3 
byo bezzasadne);
8)	wykonanie mniejszej iloci opaski z kostki betonowej przy obiekcie nr 10 (w przedmiarze przeszacowano iloci robt do wykonania);
9)	wykonanie tynku cienkowarstwowego mozaikowego na elewacji budynku nr 06 w iloci 56,97 m2 (przedmiar by przeszacowany  wystpuje omyka obliczeniowa);
10)	rzeczywiste iloci robt zwizanych z wykonaniem izolacji fundamentw i zasypek obiektu nr 09 s mniejsze (przedmiar by przeszacowany);
11)	w Protokole Koniecznoci nr 14, obejmujcym swym zakresem rezygnacj z instalacji cieplnej niskoparametrowej do budynkw nierealizowanych (objtych prawem opcji) w pozycjach  dotyczcych pukania sieci preizolowanej, prb szczelnoci rurocigw i uruchomienia rurocigw sieci cieplnych nastpia pomyka obliczeniowa. Powysze pozycje wyjto z przedmiaru z dziau sieci preizolowanych wysokoparametrowych, podczas gdy wyjte powinny zosta pozycje odnoszce si do sieci niskoparametrowej;
12)	zamontowanie mniejszej iloci zasuw eliwnych konierzowych PN16, DN 250 wzgldem przedmiaru z brany sanitarnej (przedmiar sieci zewntrznej WPP przewidywa monta 6 szt. zasuw, natomiast projekt nie przewiduje montau adnej z przedmiotowych zasuw);
13)	wykonanie zgodnie z projektem instalacji zewntrznej CO pod istniejc drog patrolow z kostki betonowej dodatkowych dwch rur osonowych o dugoci 7 mb kada (w przedmiarze wystpuje omyka obliczeniowa  uwzgldniono wykonanie 2 rur osonowych pod drog dojazdow do terenu MPS o dugoci 12 mb kada); na podstawie Protokou koniecznoci nr 18 zatwierdzonego w dniu 24.05.2024 r. zmniejszono wynagrodzenie wykonawcy - zmiana na podstawie art. 455 ust. 1 pkt 1 i pkt 4 ustawy z dnia 11 wrzenia 2019 r. Prawo zamwie publicznych.'}]}, {'test_data_suite_oid': '67feb3e6dca42e57948af96a', 'test_data_suite_id': 'sampling_eforms_all_can-1.11', 'test_data_oid': '67feb3e6dca42e57948af97c', 'test_data_id': '425773-2024', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:ChangeReason/efbc:ReasonDescription', 'value': "Tijdens het opstellen van het originele contract voor CCTV in de regio Tiel/Nijmegen was uitbreiding van CCTV bij overnachtingshaven Spijk nog niet bekend. Dit geldt ook voor de renovatie van de verkeerspost Nijmegen. Door de renovatie blijkt er onvoldoende duidelijk beeld te zijn en is het noodzakelijk dat het huidige CCTV-systeem uitgebreid wordt. Er moeten op beide locaties meer cameras geplaatst en onderhouden worden om te voldoen aan de wettelijke taak 'veilige scheepvaartbegeleiding'. Omdat de uitbreiding gentegreerd moet worden in het netwerk dat door Swarco wordt onderhouden, is het technisch te risicovol om dat een andere partij dit te laten doen. De omstandigheden zijn gewijzigd welke ten tijde van het afsluiten van het originele contract niet konden worden voorzien door RWS. De aard van de opdracht wijzigt niet; het plaatsen en onderhouden van CCTV installaties. De prijs van de wijziging is niet hoger dan 50% van de oorspronkelijke opdrachtwaarde."}]}, {'test_data_suite_oid': '67feb3e6dca42e57948af96a', 'test_data_suite_id': 'sampling_eforms_all_can-1.11', 'test_data_oid': '67feb3e6dca42e57948af982', 'test_data_id': '511729-2024', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:ChangeReason/efbc:ReasonDescription', 'value': 'Two modifications of the contract were made to reflect impacts of the Covid-19 pandemic which were unforeseeable at the time of entry into of the O&M Contract and which impacted the contractors performance of the Operations and Maintenance Contract.  These modifications are summarised as follows: 
i)	A change to the contractual indexation provisions which allow for adjustments to payments of the Base Yearly Amount to the contractor as a result of annual changes to earnings of staff members performing the Services, which is calculated by reference to economic activities in the published Nomenclature of Economic Activities (NACE) index. The modification aligned the indexation mechanism to the most appropriate category of worker involved in the delivery of the services pursuant to the contract (rather than the NACE index identified in the contract, which grouped certain categories of worker together). This modification to the NACE Index resulted in an additional payment of 3,743,858 for the period to end of June 2024 (which was in addition to an earlier payment of 378,745 made in 2020 to reflect an initial assessment of the impacts of Covid-19 at the time). 
ii)	A revision to a contractual variation to deal with the impacts of the Covid-19 pandemic to provide additional relief for certain system performance deductions (e.g. Lost Kilometre Deductions, Excess Waiting Time Deductions, Fare Evasion Deductions, Light Rail Vehicle Maintenance and Infrastructure Maintenance Deductions) incurred by the contractor.  This modification included for additional relief in the form of a reimbursement of deductions previously charged against the contractor of 7,318,000 for the period 2020 to 2023 (which represented approximately 48% of the deductions applied / charged during this period).  The review and revision to the contractual variation also resulted in the reimbursement of the contractor for certain additional labour and sub-contractor costs incurred in performing the Services (i.e. seeking to run a full timetable) to the amount of 6,372,951 for the same period between 2020 to 2023. 
As noted above the contracting authorities have commenced the procurement competition for the next generation Luas Operations and Maintenance and therefore expect that the current / existing O&M contract will not run for the full possible contract term of 132 months, which also means that the value of the contract will be lower than originally anticipated.'}]}, {'test_data_suite_oid': '67feb3e6dca42e57948af96a', 'test_data_suite_id': 'sampling_eforms_all_can-1.11', 'test_data_oid': '67feb3e6dca42e57948af987', 'test_data_id': '536356-2024', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:ChangeReason/efbc:ReasonDescription', 'value': "Modification rendue ncessaire par des circonstances qu'un pouvoir adjudicateur/une entit adjudicatrice diligent(e) ne pouvait pas prvoir [article 43, paragraphe 1, point c), de la directive 2014/23/UE; article 72, paragraphe 1, point c), de la directive 2014/24/UE; article 89, paragraphe 1, point c), de la directive 2014/25/UE]"}]}, {'test_data_suite_oid': '67feb3e6dca42e57948af96a', 'test_data_suite_id': 'sampling_eforms_all_can-1.11', 'test_data_oid': '67feb3e6dca42e57948af98e', 'test_data_id': '644753-2024', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:ChangeReason/efbc:ReasonDescription', 'value': 'W trakcie  realizacji  Umowy  stao  si  niemoliwe  wykonanie  zgodnie  z  uzgodnionym harmonogramem  realizacji  zakresu  Umowy,  migracji Systemu BSS Kontron do Systemu NSS Nokia i uruchomienie funkcjonalnoci A-flex i Gb-flex, z uwagi na okolicznoci nadzwyczajne, ktrych Zamawiajcy, dziaajc z naleyt starannoci, nie mg przewidzie, tj. przeduajce si negocjacje w ramach powizanego z  przedmiotowym  postpowaniem,  postpowania  zakupowego zmierzajcego do zawarcia umowy na przeczenie posiadanych przez Zamawiajcego Systemw BSS Kontron i BSS Nokia do Systemu NSS Nokia.'}]}], 'is_covered': True, 'xpath_conditions': [{'xpath_condition': '', 'meets_xpath_condition': True}], 'message': None}

