2. Warto przedmiotu umowy z wyczeniem czci przedmiotu umowy zwizanej z prawem opcji po zmianie (zmniejszenie wynagrodzenia): 98 573 054,59 z netto (bez VAT), 121 244 857,15 z brutto.'}]}, {'test_data_suite_oid': '67feb3e6dca42e57948af96a', 'test_data_suite_id': 'sampling_eforms_all_can-1.11', 'test_data_oid': '67feb3e6dca42e57948af97c', 'test_data_id': '425773-2024', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:Change/efbc:ChangeDescription', 'value': 'Het engineeren, uitvoeren en onderhouden van CCTV systemen voor scheepvaartbegeleiding bij de verkeersposten Dordrecht, Tiel en Nijmegen. 
Deze wijziging betreft uitbreiding van het CCTV netwerk door het installeren en onderhouden van cameras bij overnachtingshaven Spijk en de verkeerspost in Nijmegen.'}]}, {'test_data_suite_oid': '67feb3e6dca42e57948af96a', 'test_data_suite_id': 'sampling_eforms_all_can-1.11', 'test_data_oid': '67feb3e6dca42e57948af982', 'test_data_id': '511729-2024', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:Change/efbc:ChangeDescription', 'value': 'In relation to the first modification, the Nomenclature of Economic Activities (NACE) index is used in the O&M Contract as part of the indexation provisions of the O&M Contract. Due to the Covid-19 pandemic, the indexation provisions in the O&M Contract produced an irrational outcome, in circumstances where the impact of the Covid-19 pandemic affected different categories of worker in very different manners. The primary reason for the NACE Index not increasing in line with the contractors wage increases was the unforeseen collapse of the airline industry due to the worldwide COVID-19 travel restrictions which resulted in many airline staff being made redundant between 2020 and 2021 and minimal wage increases for staff that were retained. This meant that between Quarter 2 of 2019 and Quarter 2 of 2020, there was a significant and unforeseen decrease for the air transport sub-sector of NACE (c. 32%) whereas the average decrease for the three other sub-sectors of NACE was marginal (c. 3%). This significant reduction in the air transport sub-sector of NACE (as a result of the impacts of Covid-19) had a disproportionate cumulative impact on NACE Principal Activity H for 2021 such that there was no increase.  
In relation to the second modification, the contracting authorities agreed certain reliefs at the outset of the Covid-19 pandemic which sought to limit the anticipated impacts on the contractors performance of the O&M Contract including measures which sought to limit the contractors increased exposure to System Performance Deductions in accordance with the variation mechanism under the O&M Contract as well as compensation for additional unforeseen costs related to providing a full service during the pandemic. It was agreed that these measures would be revisited at a later date. Upon review, it was agreed that the measures initially agreed were insufficient to compensate the operator for the additional costs and deductions incurred pursuant to the O&M Contract arising by virtue of the Covid-19 pandemic. 
In each case, TII is satisfied that the modifications were necessary to ensure the continued provision of the services pursuant to the O&M Contract, that the modifications were brought about by circumstances which a diligent contracting authority could not have foreseen (namely the Covid-19 pandemic) and that the modifications do not alter the overall nature of the O&M Contract.'}]}, {'test_data_suite_oid': '67feb3e6dca42e57948af96a', 'test_data_suite_id': 'sampling_eforms_all_can-1.11', 'test_data_oid': '67feb3e6dca42e57948af987', 'test_data_id': '536356-2024', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:Change/efbc:ChangeDescription', 'value': "Immobilisations des ateliers de terrassement et de drainage depuis la notification du march de travaux jusqu'au 30 septembre 2023 pour un montant de 589 649.79 euros hors taxes. Valeur totale actualise du march avant les modifications (prenant en compte les ventuelles modifications contractuelles et adaptations de prix antrieures pour un montant de 2 581 383,60 euros HT) : 44 453 871,29 euros HT Montant total du march aprs les modifications : 45 043 521,08 euros HT"}]}, {'test_data_suite_oid': '67feb3e6dca42e57948af96a', 'test_data_suite_id': 'sampling_eforms_all_can-1.11', 'test_data_oid': '67feb3e6dca42e57948af98e', 'test_data_id': '644753-2024', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:Change/efbc:ChangeDescription', 'value': 'Wyduenie terminu realizacji zadania inwestycyjnego do 31.12.2025 r., przeduenie terminu realizacji wsparcia technicznego do 15.12.2024 r.,'}]}], 'is_covered': True, 'xpath_conditions': [{'xpath_condition': '', 'meets_xpath_condition': True}], 'message': None}
